import React, { Component } from "react";
import DeleteIcon from "@material-ui/icons/Delete";
import LabelIcon from "@material-ui/icons/Label";
import { typography } from "@material-ui/system";
import { Card, Tooltip, Button } from "@material-ui/core";

export class editshowordelete extends Component {
  constructor(props) {
    super(props);

    this.state = {
      open: false
    };
  }
  handleopenChange = () => {
    this.setState({
      open: true
    });
  };
  handlecloseChange = () => {
    console.log("close");

    this.setState({
      open: false
    });
  };

  render() {
    return (
      <div
        onMouseOver={this.handleopenChange}
        onMouseLeave={this.handlecloseChange}
      > 
        <typography>
        {this.state.open==false ? (
          <LabelIcon style={{ paddingTop: "5%" }} />
        ) : (
            <Tooltip title=" delete ">
                    <DeleteIcon style={{ paddingTop: "5%" }} />
                </Tooltip>

        )}</typography>
      </div>
    );
  }
}

export default editshowordelete;
